import React, { Fragment } from 'react';

const Header = (props) => (
  <Fragment>
    <div id="Header">
      Header
    </div>
    <style jsx>
      {`
        *{
          padding: 0;
          margin: 0;
          backgound-color:'black'
        }
      `}
    </style>
  </Fragment>
);

export default Header;
